        private void drawingBoard1_NewNumber(object sender, System.Collections.ArrayList lst)
        {
 
        
            DataTable tb = new DataTable();
            tb.Columns.Add("Number", 1.GetType());
            tb.Columns.Add("Error", 1.GetType());

            double minofTotal = 9999999;
            double found = 0;
            double this_total_far = 0;
            List<Point> numberfound = null;
            foreach (int[] data in Numbers)
            {
           

                        int cnt = (data.Length - 1) / 2;
                        double total = 0;
                        double total_far = 0;

                        for (int j = 0; j < lst.Count; j++)
                        {
                            double min = 999999;
                            int pick = 0;

                            for (int i = 0; i < cnt; i++)
                            {
                                Point pntref = new Point(data[1 + i * 2] , data[2 + i * 2]);
                                Point pnt = (Point)lst[j];
                                double dist = Math.Sqrt((pnt.X - pntref.X) * (pnt.X - pntref.X) + (pnt.Y - pntref.Y) * (pnt.Y - pntref.Y));
                                if (dist * dist < min)
                                {
                                    min = dist * dist;
                                    pick = j;
                                }

                            }

                            if (min > 20)
                            {
                                total_far = total_far + min;
                            }

                            total = total + min;
                        }




                        for (int i = 0; i < cnt; i++)
                        {
                            double min = 999999;
                            int pick = 0;


                            for (int j = 0; j < lst.Count; j++)
                            {
                                Point pntref = new Point(data[1 + i * 2] , data[2 + i * 2] );
                                Point pnt = (Point)lst[j];
                                double dist = Math.Sqrt((pnt.X - pntref.X) * (pnt.X - pntref.X) + (pnt.Y - pntref.Y) * (pnt.Y - pntref.Y));
                                if (dist * dist < min)
                                {
                                    min = dist * dist;
                                    pick = j;
                                }

                            }

                            if (min > 20)
                            {
                                total_far = total_far + min;
                            }

                            total = total + min;
                        }


                        tb.Rows.Add(data[0], total);
                        if (total < minofTotal)
                        {
                            minofTotal = total;
                            found = data[0];
                            List<Point> foundDots = new List<Point>();
                            int acnt = (data.Length - 1) / 2;
                            for (int i = 0; i < acnt; i++)
                            {
                                foundDots.Add(new Point(data[1 + i * 2], data[2 + i * 2]));
                            }

                            numberfound = foundDots;
                            this_total_far = total_far;
                        }
                
            }

            tb.DefaultView.Sort = "Error DESC";
            tb = tb.DefaultView.ToTable();
            string txt = "";
            foreach (DataRow rw in tb.Rows)
            {
                txt= txt+rw[0].ToString() + " " + rw[1].ToString() + "\r\n"; 
            }

            textBox2.Text = txt;
            textBox2.SelectionStart = textBox2.Text.Length;
            textBox2.ScrollToCaret();

            label1.Text = found.ToString();
            if (this_total_far > 300)                   
            {              
                string line = "";
                foreach (Point pnt in lst)
                {
                    if (line != "")
                        line = line + ",";
                    line = line + pnt.X.ToString() + "," + pnt.Y.ToString();
                }
                //  List<int[]> Numbers = new List<int[]>();
                // Numbers.Add(new int[] { 146, 181, 155, 181, 167, 184, 180, 187, 194, 190, 207, 191, 218, 193, 228, 193, 239, 193, 249, 193, 262, 193, 272, 193, 284, 193, 294, 193, 304, 193, 300, 204, 296, 211, 290, 218, 282, 231, 276, 239, 270, 248, 262, 262, 256, 276, 249, 290, 246, 303, 244, 317, 239, 332, 237, 345, 231, 362, 228, 377, 225, 389, 222, 399, 220, 407, 218, 415, 217, 425, 214, 435, 213, 447, 210, 458, 208, 468, 207, 478, 206, 487, 204, 497, 203, 510, 201, 521, 198, 530, 197, 538, 196, 548, 190, 564, 187, 573, 186, 582, 186, 582 });
                if (textBox1.Text!=label1.Text)
                textBox3.AppendText("Numbers.Add(new int[]{" + textBox1.Text + "," + line + "});\r\n");

            }

            drawingBoard1.DrawFoundNumber(numberfound);
        }

    }
